import React, { Component } from 'react';
import {Link} from 'react-router-dom'

export default class SignUp extends Component {

  state={
    name:"",
    phone:"",
    Balance:"",
    Password:""
  };

  changeValue =(e)=>{
    this.setState({[e.target.name]:e.target.value})
  }
  render() {

    return (
      <React.Fragment>

        <form>

          <div className="d-flex flex-column align-items-center" style={{marginTop:'120px'}}>
          <div className="form-group w-25">
            <input type="text" name="name" value={this.state.name} className="form-control" onChange={this.changeValue} placeholder="Enter Name ..." />
          </div>

          <div className="form-group w-25">
            <input type="tel" name="phone" value={this.state.name} className="form-control" placeholder="Enter Phone Number ..." />
          </div>

          <div className="form-group w-25">
            <input type="number" name="Balance" value={this.state.name} className="form-control" placeholder="Enter Balance ..." />
          </div>

          <div className="form-group w-25">
            <input type="password" name="Password" className="form-control" placeholder=" Enter Password ..." />
          </div>


          {/* <Link to=""> */}
          <button type="submit" className="btn btn-primary">SignUp</button>
          {/* </Link>  */}

          </div>

        </form>
      </React.Fragment>
    );
  }
}
